import React from 'react';
import './panel.css';
class Panel extends React.Component
{
	render()
	{
		return <div id = "panel">		
		<i className = "fab fa-github" style="font-size: 1.5em; border-radius: 50%;"></i>
		</div>
	}
}

export default Panel;
